(29, 'DIYU CONCERT', 'yuhu', '<p><br></p><p><span style=\"color: rgb(38, 38, 38);\">Salah satu nilai filosofis yang terbilang misterius dari orang Jawa adalah: \'Sastra Jendra Hayuningrat Pangruwating Diyu\'. Sastra Jendra Hayuningrat bisa diartikan sebagai \'Ilmu dari Tuhan yang bisa menyelamatkan dunia\'. Sedangkan \'Pangruwating Diyu\' bisa diartikan sebagai (dengan) \'Cara menjinakkan Raksasa\'. Dalam hal ini, Diyu yang diartikan sebagai raksasa merupakan simbol dari angkara murka ataupun hal-hal negatif.</span></p><p><br></p><p><span style=\"color: rgb(38, 38, 38);\">Manusia dengan segala kebaikannya, tentunya punya sisi kejahatannya. Demikian juga sebaliknya, Manusia jahat pun pasti punya kebaikan. Tidak ada manusia yang seratus persen baik dan tidak ada juga manusia yang seratus persen jahat. Baik dan Jahat hanyalah persepsi semata karena berlapis-lapis kesadaran manusia dalam memahami fenomena yang kemudian dipersepsi sebagai baik ataupun jahat. Jadilah bagian dari manusia yang saling belajar tentang spektrum kemanusiaan secara luas, tidak terikat pada perspektif semu baik ataupun jahat semata pada acara: DIYU CONCERT yang disajikan oleh&nbsp;</span><a href=\"https://www.instagram.com/hellhouse_indo/\" target=\"_blank\" style=\"color: rgb(38, 38, 38);\">@hellhouse_indo</a><span style=\"color: rgb(38, 38, 38);\">&nbsp;, menampilkan lakon&nbsp;</span><a href=\"https://www.instagram.com/mario_zwinkle/\" target=\"_blank\" style=\"color: rgb(38, 38, 38);\">@mario_zwinkle</a><span style=\"color: rgb(38, 38, 38);\">&nbsp;&amp; Joyosudarmos di Panggung Sekolah Hutan Pinusari - 10 Juli 2022.</span></p><p><br></p><p><span style=\"color: rgb(38, 38, 38);\">Pre-Sale tiket tersedia di&nbsp;</span><a href=\"https://www.instagram.com/tiketcom/\" target=\"_blank\" style=\"color: rgb(38, 38, 38);\">@tiketcom</a></p><p><br></p><p><a href=\"https://www.instagram.com/explore/tags/diyuconcert/\" target=\"_blank\">#diyuconcert</a></p><p><a href=\"https://www.instagram.com/explore/tags/mariozwinkle/\" target=\"_blank\">#mariozwinkle</a></p><p><a href=\"https://www.instagram.com/explore/tags/joyosudarmos/\" target=\"_blank\">#joyosudarmos</a></p><p><a href=\"https://www.instagram.com/explore/tags/hellhouse/\" target=\"_blank\">#hellhouse</a></p>', '2022-07-25 01:00:00', '2022-07-25 04:00:00', 'gedung wonosari', 0xe610000001010000001052b22326a65b40021095ae66d81fc0, '/storage/events/1657644399_Screenshot (756).png', 'https://www.google.com/maps/dir/?api=1&destination=-7.961329200599723,110.59607784666173', 2, 2, 6, '2022-07-12 08:25:40', '2022-07-12 08:46:39', NULL),
